const LanguageLevels = ['A1', 'A2', 'B1', 'B2', 'C1', 'C2'];
/**
 * @class Employee DTO
 * @property {Number} sap
 * @property {String} name
 * @property {ObjectId} role
 * @property {ObjectId} supportType
 * @property {ObjectId} project
 * @property {ObjectId} rm
 * @property {String} email
 * @property {ObjectId} mainlanguage
 * @property {Enum} mainlanguageLevel ['A1', 'A2', 'B1', 'B2', 'C1', 'C2']
 * @property {ObjectId} secondlanguage
 * @property {Enum} secondlanguageLevel ['A1', 'A2', 'B1', 'B2', 'C1', 'C2']
 * @property {ObjectId} thirdlanguage
 * @property {Enum} thirdlanguageLevel ['A1', 'A2', 'B1', 'B2', 'C1', 'C2']
 */
export default class Employee {
   constructor(
      sap,
      name,
      role,
      supportType,
      project,
      rm,
      email,
      mainlanguage,
      mainlanguageLevel,
      secondlanguage,
      secondlanguageLevel,
      thirdlanguage,
      thirdlanguageLevel
   ) {
      this.sap = sap;
      this.name = name;
      this.role = role;
      this.supportType = supportType;
      this.project = project;
      this.rm = rm;
      this.email = email;
      this.mainlanguage = mainlanguage;
      this.mainlanguageLevel = mainlanguageLevel;
      this.secondlanguage = secondlanguage;
      this.secondlanguageLevel = secondlanguageLevel;
      this.thirdlanguage = thirdlanguage;
      this.thirdlanguageLevel = thirdlanguageLevel;
   }

   getEmployeeDTO() {
      return {
         employee: {
            sap: this.sap,
            name: this.name,
            role: this.role,
            supportType: this.supportType,
            project: this.project,
            rm: this.rm,
            email: this.email,
            mainlanguage: this.mainlanguage,
            mainlanguageLevel: this.mainlanguageLevel,
            secondlanguage: this.secondlanguage,
            secondlanguageLevel: this.secondlanguageLevel,
            thirdlanguage: this.thirdlanguage,
            thirdlanguageLevel: this.thirdlanguageLevel
         }
      };
   }
}
